INSERT INTO `moves` VALUES (1,'pay-day',0,'Inflicts regular damage.  After the battle ends, the winner receives five times the user\'s level in extra money for each time this move was used.',40,20,100,0,'physical'),(2,'swords-dance',0,'Raises the user\'s Attack by two stages.',0,20,0,0,'status'),(3,'vise-grip',0,'Inflicts regular damage.',55,30,100,0,'physical'),(4,'wing-attack',2,'Inflicts regular damage.',60,35,100,0,'physical'),(5,'razor-wind',0,'Inflicts regular damage.  User\'s critical hit rate is one level higher when using this move.  User charges for one turn before attacking.This move cannot be selected by sleep talk.',80,10,100,0,'special'),(6,'guillotine',0,'Inflicts damage equal to the target\'s max HP.  Ignores accuracy and evasion modifiers.  This move\'s accuracy is 30% plus 1% for each level the user is higher than the target.  If the user is a lower level than the target, this move will fail.Because this move inflicts a specific and finite amount of damage, endure still prevents the target from fainting.The effects of lock on, mind reader, and no guard still apply, as long as the user is equal or higher level than the target.  However, they will not give this move a chance to break through detect or protect.',0,5,30,0,'physical'),(7,'double-slap',0,'Inflicts regular damage.  Hits 2–5 times in one turn.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.',15,10,85,0,'physical'),(8,'gust',2,'Inflicts regular damage.If the target is under the effect of bounce, fly, or sky drop, this move will hit with double power.',40,35,100,0,'special'),(9,'fly',2,'Inflicts regular damage.  User flies high into the air for one turn, becoming immune to attack, and hits on the second turn.During the immune turn, gust, hurricane, sky uppercut, smack down, thunder, twister, and whirlwind still hit the user normally.  gust and twister also have double power against the user.The damage from hail and sandstorm s