ity is in effect.',100,10,95,0,'physical'),(23,'sonic-boom',0,'Inflicts exactly 20 damage.',0,20,90,0,'special'),(24,'stun-spore',11,'Paralyzes the target.',0,30,75,0,'status'),(25,'submission',3,'Inflicts regular damage.  User takes 1/4 the damage it inflicts in recoil.',80,20,80,0,'physical'),(26,'blizzard',17,'Inflicts regular damage.  Has a 10% chance to freeze the target.During hail, this move has 100% accuracy.  It also has a (100 - accuracy)% chance to break through the protection of protect and detect.',110,5,70,0,'special'),(27,'mist',17,'Pokémon on the user\'s side of the field are immune to stat-lowering effects for five turns.guard swap, heart swap, and power swap may still be used.defog used by an opponent will end this effect.',0,30,0,0,'status'),(28,'rolling-kick',3,'Inflicts regular damage.  Has a 30% chance to make the target flinch.',60,15,85,0,'physical'),(29,'focus-energy',0,'User\'s critical hit rate is two levels higher until it leaves the field.  If the user has already used focus energy since entering the field, this move will fail.This effect is passed on by baton pass.',0,30,0,0,'status'),(30,'thunder-wave',7,'Paralyzes the target.',0,20,90,0,'status'),(31,'flamethrower',9,'Inflicts regular damage.  Has a 10% chance to burn the target.',90,15,100,0,'special'),(32,'mirror-move',2,'Uses the last move targeted at the user by a Pokémon still on the field.  A move counts as targeting the user even if it hit multiple Pokémon, as long as the user was one of them; however, moves targeting the field itself do not count.  If the user has not been targeted by an appropriate move since entering the field, or if no Pokémon that targeted the user remains on the field, this move will fail.Moves that failed, missed, had no effect, or were blocked are still copied.Assist moves, time-delayed moves, “meta” moves that operate on other moves/Pokémon/abilities, and some other special moves cannot be copied and are ignored; if the last move to hit the user was such a move, the previous move will be used instead.  The full list of ignored moves is: acid armor, acupressure, after you, agility, ally switch, amnesia, aqua ring, aromatherapy, aromatic mist, assist, autotomize, barrier, baton pass, belch, belly drum, bide, bulk up, calm mind, camouflage, celebrate, charge, coil, conversion, conversion 2, copycat, cosmic power, cotton guard, counter, crafty shield, curse, defend order, defense curl, destiny bond, detect, doom desire, double team, dragon dance, electric terrain, endure, final gambit, flower shield, focus energy, focus punch, follow me, future sight, geomancy, grassy terrain, gravity, growth, grudge, guard split, hail, happy hour, harden, haze, heal bell, heal order, heal pulse, healing wish, helping hand, hold hands, hone claws, howl, imprison, ingrain, ion deluge, iron defense, kings shield, light screen, lucky chant, lunar dance, magic coat, magnet rise, magnetic flux, mat block, me first, meditate, metronome, milk drink, mimic, minimize, mirror coat, mirror move, mist, misty terrain, moonlight, morning sun, mud sport, nasty plot, nature power, perish song, power split, power trick, protect, psych up, quick guard, quiver dance, rage powder, rain dance, recover, recycle, reflect, reflect type, refresh, rest, rock polish, role play, roost, rototiller, safeguard, sandstorm, shadow blast, shadow bolt, shadow half, shadow rush, shadow shed, shadow sky, shadow storm, shadow wave, sharpen, shell smash, shift gear, sketch, slack off, sleep talk, snatch, soft boiled, spikes, spiky shield, spit up, splash, stealth rock, sticky web, stockpile, struggle, substitute, sunny day, swallow, swords dance, synthesis, tail glow, tailwind, teleport, toxic spikes, transform, water sport, wide guard, wish, withdraw and work up.This move cannot be selected by assist, metronome, or sleep talk, nor forced by encore.',0,20,0,0,'status'),(33,'mega-kick',0,'Inflicts regular damage.',120,5,75,0,'physical'),(34,'solar-beam',11,'Inflicts regular damage.  User charges for one turn before attacking.During sunny day, the charge turn is skipped.During hail, rain dance, or sandstorm, power is halved.This move cannot be selected by sleep talk.',120,10,100,0,'special'),(35,'aurora-beam',17,'Inflicts regular damage.  Has a 10% chance to lower the target\'s Attack by one stage.',65,20,100,0,'special'),(36,'comet-punch',0,'Inflicts regular damage.  Hits 2–5 times in one turn.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.',18,15,85,0,'physical'),(37,'poison-sting',12,'Inflicts regular damage.  Has a 30% chance to poison the target.',15,35,100,0,'physical'),(38,'ember',9,'Inflicts regular damage.  Has a 10% chance to burn the target.',40,25,100,0,'special'),(39,'spite',4,'Lowers the PP of the target\'s last used move by 4.  If the target hasn\'t used a move since entering the field, if it tried to use a move this turn and failed, or if its last used move has 0 PP remaining, this move will fail.',0,10,100,0,'status'),(40,'teleport',14,'Does nothing.  Wild battles end immediately.',0,20,0,0,'status'),(41,'twineedle',5,'Inflicts regular damage.  Hits twice in the same turn.  Has a 20% chance to poison the target.',25,20,100,0,'physical'),(42,'thunder',7,'Inflicts regular damage.  Has a 30% chance to paralyze the target.During rain dance, this move has 100% accuracy.  It also has a (100 - accuracy)% chance to break through the protection of protect and detect.During sunny day, this move has 50% accuracy.',110,10,70,0,'special'),(43,'surf',8,'Inflicts regular damage.If the target is in the first turn of dive, this move will hit with double power.',90,15,100,0,'special'),(44,'smokescreen',0,'Lowers the target\'s accuracy by one stage.',0,20,100,0,'status'),(45,'leech-seed',11,'Plants a seed on the target that drains 1/8 of its max HP at the end of every turn and heals the user for the amount taken.  Has no effect on grass Pokémon.  The seed remains until t