cted to heal the user.',40,15,100,0,'special'),(85,'safeguard',0,'Protects Pokémon on the user\'s side of the field from major status effects and confusion for five turns.  Does not cancel existing ailments.  This effect remains even if the user leaves the field.If yawn is used while this move is in effect, it will immediately fail.defog used by an opponent will end this effect.This effect does not prevent the confusion caused by outrage, petal dance, or thrash.',0,25,0,0,'status'),(86,'aeroblast',2,'Inflicts regular damage.  User\'s critical hit rate is one level higher when using this move.',100,5,95,0,'special'),(87,'supersonic',0,'Confuses the target.',0,20,55,0,'status'),(88,'rest',14,'User falls to sleep and immediately regains all its HP.  If the user has another major status effect, sleep will replace it.  The user will always wake up after two turns, or one turn with early bird.This move fails if the Pokémon cannot fall asleep due to uproar, insomnia, or vital spirit.  It also fails if the Pokémon is at full health or is already asleep.',0,10,0,0,'status'),(89,'cotton-spore',11,'Lowers the target\'s Speed by two stages.',0,40,100,0,'status'),(90,'iron-tail',1,'Inflicts regular damage.  Has a 30% chance to lower the target\'s Defense by one stage.',100,15,75,0,'physical'),(91,'rapid-spin',0,'Inflicts regular damage.  Removes leech seed from the user, frees the user from bind, clamp, fire spin, magma storm, sand tomb, whirlpool, and wrap, and clears spikes, stealth rock, and toxic spikes from the user\'s side of the field.  If this move misses or has no effect, its effect doesn\'t activate.',50,40,100,0,'physical'),(92,'bind',0,'Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  