physical'),(107,'hail',17,'Changes the weather to hail for five turns, during which non-ice Pokémon are damaged for 1/16 their max HP at the end of every turn.If the user is holding icy rock, this effect lasts for eight turns.blizzard has 100% accuracy.  If the target has used detect or protect, blizzard has a (100 - accuracy)% chance to break through the protection.moonlight, morning sun, and synthesis heal only 1/4 of the user\'s max HP.Pokémon with snow cloak are exempt from this effect\'s damage.',0,10,0,0,'status'),(108,'mimic',0,'This move is replaced by the target\'s last successfully used move, and its PP changes to 5.  If the target hasn\'t used a move since entering the field, if it tried to use a move this turn and failed, or if the user already knows the targeted move, this move will fail.  This effect vanishes when the user leaves the field.If chatter, metronome, mimic, sketch, or struggle is selected, this move will fail.This move cannot be copied by mirror move, nor selected by assist or metronome, nor forced by encore.',0,10,0,0,'status'),(109,'assist',0,'Uses a move from another Pokémon in the user\'s party, both selected at random.  Moves from fainted Pokémon can be used.  If there are no eligible Pokémon or moves, this move will fail.This move will not select assist, chatter, circle throw, copycat, counter, covet, destiny bond, detect, dig, dive, dragon tail, endure, feint, fly focus punch, follow me, helping hand, me first, metronome, mimic, mirror coat, mirror move, phantom force protect, quick guard, roar shadow force, sketch, sleep talk, snatch, struggle, switcheroo, thief, trick, whirlwind, or wide guard.This move cannot be copied by mirror move, nor selected by metronome or sleep talk.',0,20,0,0,'status'),(110,'lock-on',0,'If the user targets the same target again before the end of the next turn, the move it uses is guaranteed to hit.  This move itself also ignores accuracy and evasion modifiers.One-hit KO moves are also guaranteed to hit, a