status'),(115,'trick',14,'User and target permanently swap held items.  Works even if one of the Pokémon isn\'t holding anything.  If either Pokémon is holding mail, this move will fail.If either Pokémon has multitype or sticky hold, this move will fail.If this move results in a Pokémon obtaining choice band, choice scarf, or choice specs, and that Pokémon was the latter of the pair to move this turn, then the move it used this turn becomes its chosen forced move.  This applies even if both Pokémon had a choice item before this move was used.  If the first of the two Pokémon gains a choice item, it may select whatever choice move it wishes next turn.Neither the user nor the target can recover its item with recycle.This move cannot be selected by assist or metronome.',0,10,100,0,'status'),(116,'heal-bell',0,'Removes major status effects and confusion from every Pokémon in the user\'s party.',0,5,0,0,'status'),(117,'recover',0,'Heals the user for half its max HP.',0,10,0,0,'status'),(118,'thunder-punch',7,'Inflicts regular damage.  Has a 10% chance to paralyze the target.',75,15,100,0,'physical'),(119,'charge',7,'Raises the user\'s Special Defense by one stage.  If the user uses an electric move next turn, its power will be doubled.',0,20,0,0,'status'),(120,'moonlight',6,'Heals the user for half its max HP.During sunny day, the healing is increased to 2/3 max HP.During hail, rain dance, or sandstorm, the healing is decreased to 1/4 max HP.',0,5,0,0,'status'),(121,'psych-up',0,'Discards the user\'s stat changes and copies the target\'s.This move cannot be copied by mirror move.',0,10,0,0,'status'),(122,'thunder-shock',7,'Inflicts regular damage.  Has a 10% chance to paralyze the target.',40,30,100,0,'special'),(123,'mega-punch',0,'Inflicts regular damage.',80,20,85,0,'physical'),(124,'foresight',0,'Resets the target\'s evasion to normal and prevents any further boosting until the target leaves the field.  A ghost under this effect takes normal damage from normal and fi