 accuracy)% chance to break through the protection.solar beam has half power.moonlight, morning sun, and synthesis heal only 1/4 of the user\'s max HP.Pokémon with swift swim have doubled original Speed.Pokémon with forecast become water.Pokémon with dry skin heal 1/8 max HP, Pokémon with hydration are cured of major status effects, and Pokémon with rain dish heal 1/16 max HP at the end of each turn.',0,5,0,0,'status'),(694,'shadow-down',18,'Lowers the target\'s Defense by two stages.',0,0,100,0,'status'),(695,'shadow-sky',18,'Changes the weather to Shadow Sky for five turns.  Pokémon other than shadow Pokémon take 1/16 their max HP at the end of every turn.  This move is typeless for the purposes of weather ball.',0,0,0,0,'status'),(696,'double-edge',0,'Inflicts regular damage.  User takes 1/3 the damage it inflicts in recoil.',120,15,100,0,'physical'),(697,'outrage',10,'Inflicts regular damage.  User is forced to attack with this move for 2–3 turns,selected at random.  After the last hit, the user becomes confused.safeguard does not protect against the confusion from this move.',120,10,100,0,'physical'),(698,'uproar',0,'Inflicts regular damage.  User is forced to use this move for 2–5 turns, selected at random.  All Pokémon on the field wake up, and none can fall to sleep until the lock-in ends.Pokémon cannot use rest during this effect.This move cannot be selected by sleep talk.',90,10,100,0,'special'),(699,'encore',0,'The next 4–8 times (selected at random) the target attempts to move, it is forced to repeat its last used move.  If the selected move allows the trainer to select a target, an opponent will be selected at random each turn.  If the target is prevented from using the selected move by some other effect, struggle will be used instead.  This effect ends if the selected move runs out of PP.If the target hasn\'t used a move since entering the field, if it tried to use a move this turn and failed, if it does not know the selected move, or if the selected move has 0 PP remaining, this move will fail.  If the target\'s last used move was encore, mimic, mirror move, sketch, struggle, or transform, this move will fail.',0,5,100,0,'status'),(700,'roost',2,'Heals the user for half its max HP.  If the user is flying, its flying type is ignored until the end of this turn.',0,10,0,0,'status'),(701,'supersonic-skystrike--physical',2,'Inflicts regular damage.',0,1,0,0,'physical'),(702,'stoked-sparksurfer',7,'Inflicts regular damage.  Has a 100% chance to paralyze the target.',175,1,0,0,'special'),(703,'shadow-rush',18,'Inflicts regular damage.  User\'s critical hit rate is one level higher when using this move while in hyper mode.',55,0,100,0,'physical'),(704,'withdraw',8,'Raises the user\'s Defense by one stage.',0,40,0,0,'status'),(705,'grass-whistle',11,'Puts the target to sleep.',0,15,55,0,'status'),(706,'max-quake',15,'',0,0,0,0,'status'),(707,'struggle',0,'Inflicts typeless regular damage.  User takes 1/4 its max HP in recoil.  Ignores accuracy and evasion modifiers.This move is used automatically when a Pokémon cannot use any other move legally, e.g., due to having no PP remaining or being under the effect of both encore and torment at the same time.This move\'s recoil is not treated as recoil for the purposes of anything that affects recoil, such as the ability rock head.  It also is not prevented by magic guard.This move cannot be copied by mimic, mirror move, or sketch, nor selected by assist or metronome, nor forced by encore.',50,1,0,0,'physical'),(708,'screech',0,'Lowers the target\'s Defense by two stages.',0,40,85,0,'status'),(709,'present',0,'Randomly uses one of the following effects.Effect                                             | Chance-------------------------------------------------- | -----:Inflicts regular damage with 40 power  |    40%Inflicts regular damage with 80 power  |    30%Inflicts regular damage with 120 power |    10%Heals the target for 1/4 its max HP    |    20%On average, this move inflicts regular damage with 52 power and heals the target for 1/20 its max HP.',0,15,90,0,'physical'),(710,'oceanic-operetta',8,'Inflicts regular damage.',195,1,0,0,'special'),(711,'tar-shot',13,'',0,15,100,0,'status'),(712,'burning-jealousy',9,'',70,5,100,0,'special'),(713,'bug-bite',5,'Inflicts regular damage.  If the target is holding a berry, this move has double power, and the user takes the berry and uses it immediately.If the target is holding a jaboca berry or rowap berry, the berry is still removed, but has no effect.If this move is super effective and the target is holding a berry that can reduce this move\'s damage, it will do so, and will not be stolen.',60,20,100,0,'physical'),(714,'flatter',16,'Raises the target\'s Special Attack by one stage, then confuses it.',0,15,100,0,'status'),(715,'magic-powder',14,'',0,20,100,0,'status'),(716,'moonblast',6,'Inflicts regular damage.  Has a 30% chance to lower the target\'s Special Attack by one stage.',95,15,100,0,'special'),(717,'embargo',16,'Target cannot use its held item for five turns.  If the target leaves the field, this effect ends.If a Pokémon under this effect uses bug bite or pluck on a Pokémon holding a berry, the berry is destroyed but not used.  If a Pokémon under this effect uses fling, it will fail.This effect is passed by baton pass.',0,15,100,0,'status'),(718,'hyperspace-hole',14,'Inflicts regular damage.  Bypasses and removes any protection effect on the target.',80,5,0,0,'special'),(719,'frustration',0,'Inflicts regular damage.  Power increases inversely with happiness, given by `(255 - happiness) * 2 / 5`, to a maximum of 102.  Power bottoms out at 1.',0,20,100,0,'physical'),(720,'role-play',14,'User\'s ability is replaced with the target\'s until the user leaves the field.  Ignores accuracy and evasion modifiers.If the target has flower gift, forecast, illusion, imposter, multitype, stance change, trace, wonder guard, or zen mode, this move will fail.This move cannot be copied by mirror move.',0,10,0,0,'status'),(721,'conversion-2',0,'Changes the user\'s type to a type either resistant or immune to the last damaging move that hit it.  The new type is selected at random and cannot be a type the user already is.  If there is no eligible new type, this move will fail.',0,30,0,0,'status'),(722,'metronome',0,'Selects any move at random and uses it.  Moves the user already knows are not eligible.  Assist, meta, protection, and reflection moves are also not eligible; specifically, assist, chatter, copycat, counter, covet, destiny bond, detect, endure, feint, focus punch, follow me, helping hand, me first, metronome, mimic, mirror coat, mirror move, protect, quick guard, sketch, sleep talk, snatch, struggle, switcheroo, thief, trick, and wide guard will not be selected by this move.This move cannot be copied by mimic or mirror move, nor selected by assist, metronome, or sleep talk.',0,10,0,0,'status'),(723,'mach-punch',3,'Inflicts regular damage.',40,30,100,1,'physical'),(724,'amnesia',14,'Raises the user\'s Special Defense by two stages.',0,20,0,0,'status'),(725,'belch',12,'Inflicts regular damage.  Can only be used if the user has eaten a berry since the beginning of the battle.After the user eats a berry, it may use this move any number of times until the end of the battle, even if it switches out.  Eating a held berry, eating a berry via bug bite or pluck, or being the target of a Flung berry will enable this move.  Feeding a Pokémon a berry from the bag or using natural gift will not.If the trainer chooses this move when it cannot be used, the choice is rejected outright and the trainer must choose another move.',120,10,90,0,'special'),(726,'kings-shield',1,'Blocks damaging attacks and lowers attacking Pokémon\'s Attack by two stages on contact.  Switches Aegislash to Shield Forme.',0,10,0,4,'status'),(727,'tickle',0,'Lowers the target\'s Attack and Defense by one stage.',0,20,100,0,'status'),(728,'zap-cannon',7,'Inflicts regular damage.  Has a 100% chance to paralyze the target.',120,5,50,0,'special'),(729,'steel-wing',1,'Inflicts regular damage. Has a 10% chance to raise the user\'s Defense one stage.',70,25,90,0,'physical'),(730,'force-palm',3,'Inflicts regular damage.  Has a 30% chance to paralyze the target.',60,10,100,0,'physical'),(731,'drain-punch',3,'Inflicts regular damage.  Drains half the damage inflicted to heal the user.',75,10,100,0,'physical'),(732,'quiver-dance',5,'Raises the user\'s Special Attack, Special Defense, and Speed by one stage each.',0,20,0,0,'status'),(733,'substitute',0,'Transfers 1/4 the user\'s max HP into a doll that absorbs damage and causes most negative move effects to fail.  If the user leaves the field, the doll will vanish.  If the user cannot pay the HP cost, this move will fail.The doll takes damage as normal, using the user\'s stats and types, and will break when its HP reaches zero.  Self-inflicted damage from confusion or recoil is not absorbed.  Healing effects from opponents ignore the doll and heal the user as normal.  Moves that work based on the user\'s HP still do so; the doll\'s HP does not influence any move.The doll will block major status effects, confusion, and flinching.  The effects of smelling salts and wake up slap do not trigger against a doll, even if the Pokémon behind the doll has the appropriate major status effect.  Multi-turn trapping moves like wrap will hit the doll for their regular damage, but the multi-turn trapping and damage effects will not activate.Moves blocked or damage absorbed by the doll do not count as hitting the user or inflicting damage for any effects that respond to such, e.g., avalanche, counter, or a rowap berry.  magic coat still works as normal, even against moves the doll would block.  Opposing Pokémon that damage the doll with a leech move like absorb are healed as normal.It will also block acupressure, block, the curse effect of curse, dream eater, embargo, flatter, gastro acid, grudge, heal block, leech seed, lock on, mean look, mimic, mind reader, nightmare, pain split, psycho shift, spider web, sketch, swagger, switcheroo, trick, worry seed, and yawn.  A Pokémon affected by yawn before summoning the doll will still fall to sleep.The doll blocks intimidate, but all other abilities act as though the doll did not exist.  If the user has an ability that absorbs moves of a certain type for HP (such as volt absorb absorbing thunder wave), such moves will not be blocked.life orb and berries that cause confusion still work as normal, but their respective HP loss and confusion are absorbed/blocked by the doll.The user is still vulnerable to damage inflicted when entering or leaving the field, such as by pursuit or spikes; however, the doll will block the poison effect of toxic spikes.The doll is passed on by baton pass.  It keeps its existing HP, but uses the replacement Pokémon\'s stats and types for damage calculation.All other effects work as normal.',0,10,0,0,'status'),(734,'terrain-pulse',0,'',50,10,100,0,'special'),(735,'skitter-smack',5,'',70,10,90,0,'physical'),(736,'mean-look',0,'The target cannot switch out normally.  Ignores accuracy and evasion modifiers.  This effect ends when the user leaves the field.The target may still escape by using baton pass, u turn, or a shed shell.Both the user and the target pass on this effect with baton pass.',0,5,0,0,'status'),(737,'acid-downpour--physical',12,'Inflicts regular damage.',0,1,0,0,'physical'),(738,'crunch',16,'Inflicts regular damage.  Has a 20% chance to lower the target\'s Defense by one stage.',80,15,100,0,'physical'),(739,'silver-wind',5,'Inflicts regular damage. Has a 10% chance to raise all of the user\'s stats one stage.',60,5,100,0,'special'),(740,'lick',4,'Inflicts regular damage.  Has a 30% chance to paralyze the target.',30,30,100,0,'physical'),(741,'rock-throw',13,'Inflicts regular damage.',50,15,90,0,'physical'),(742,'agility',14,'Raises the user\'s Speed by two stages.',0,30,0,0,'status'),(743,'acid-armor',12,'Raises the user\'s Defense by two stages.',0,20,0,0,'status'),(744,'shadow-storm',18,'Inflicts regular damage.',95,0,100,0,'special'),(745,'snipe-shot',8,'',80,15,100,0,'special'),(746,'transform',0,'User copies the target\'s species, weight, type, ability, calculated stats (except HP), and moves.  Copied moves will all have 5 PP remaining.  IVs are copied for the purposes of hidden power, but stats are not recalculated.choice band, choice scarf, and choice specs stay in effect, and the user must select a new move.This move cannot be copied by mirror move, nor forced by encore.',0,10,0,0,'status'),(747,'twister',10,'Inflicts regular damage.  Has a 20% chance to make each target flinch.If the target is under the effect of bounce, fly, or sky drop, this move will hit with double power.',40,20,100,0,'special'),(748,'fire-pledge',9,'Inflicts regular damage.  If a friendly Pokémon used water pledge earlier this turn, moves used by any friendly Pokémon have doubled effect chance for four turns (including this one).',80,10,100,0,'special'),(749,'brave-bird',2,'Inflicts regular damage.  User takes 1/3 the damage it inflicts in recoil.',120,15,100,0,'physical'),(750,'toxic-thread',12,'Poisons the target and lowers its Speed by one stage.',0,20,100,0,'status'),(751,'eternabeam',10,'',160,5,90,0,'special'),(752,'shadow-hold',18,'The target cannot switch out normally.  Ignores accuracy and evasion modifiers.  This effect ends when the user leaves the field.The target may still escape by using baton pass, u turn, or a shed shell.Both the user and the target pass on this effect with baton pass.',0,0,0,0,'status'),(753,'mat-block',3,'Protects all friendly Pokémon from damaging moves.  Only works on the first turn after the user is sent out.',0,10,0,0,'status'),(754,'rock-wrecker',13,'Inflicts regular damage.  User loses its next turn to \"recharge\", and cannot attack or switch out during that turn.',150,5,90,0,'physical'),(755,'extreme-speed',0,'Inflicts regular damage.',80,5,100,2,'physical'),(756,'psycho-cut',14,'Inflicts regular damage.  User\'s critical hit rate is one level higher when using this move.',70,20,100,0,'physical'),(757,'shadow-half',18,'Halves HP of all Pokémon on the field.  User loses its next turn to \"recharge\", and cannot attack or switch out during that turn.',0,0,100,0,'special'),(758,'protect',0,'No moves will hit the user for the remainder of this turn.  If the user is last to act this turn, this move will fail.If the user successfully used detect, endure, protect, quick guard, or wide guard on the last turn, this move has a 50% chance to fail.lock on, mind reader, and no guard provide a (100 – accuracy)% chance for moves to break through this move.  This does not apply to one-hit KO moves (fissure, guillotine, horn drill, and sheer cold); those are always blocked by this move.thunder during rain dance and blizzard during hail have a 30% chance to break through this move.The following effects are not prevented by this move:* acupressure from an ally* curse\'s curse effect* Delayed damage from doom desire and future sight; however, these moves will be prevented if they are used this turn* feint, which will also end this move\'s protection after it hits* imprison* perish song* shadow force* Moves that merely copy the user, such as transform or psych upThis move cannot be selected by assist or metronome.',0,10,0,4,'status'),(759,'defog',2,'Lowers the target\'s evasion by one stage.  Clears away fog.  Removes the effects of mist, light screen, reflect, safeguard, spikes, stealth rock, and toxic spikes from the target\'s side of the field.If the target is protected by mist, it will prevent the evasion change, then be removed by this move.',0,15,0,0,'status'),(760,'whirlpool',8,'Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.If the target is in the first turn of dive, this move will hit with double power.',35,15,85,0,'special'),(761,'geomancy',6,'Takes one turn to charge, then raises the user\'s Special Attack, Special Defense, and Speed by two stages.',0,10,0,0,'status'),(762,'spark',7,'Inflicts regular damage.  Has a 30% chance to paralyze the target.',65,20,100,0,'physical'),(763,'camouflage',0,'User\'s type changes according to the terrain.Terrain        | New type-------------- | --------------Building       | normalCave           | rockDesert         | groundGrass          | grassMountain       | rockOcean          | waterPond           | waterRoad           | groundSnow           | iceTall grass     | grassIn Pokémon Battle Revolution:Terrain        | New type-------------- | --------------Courtyard      | normalCrystal        | rockGateway        | waterMagma          | rockMain Street    | normalNeon           | normalStargazer      | rockSunny Park     | grassSunset         | groundWaterfall      | grass',0,20,0,0,'status'),(764,'blue-flare',9,'Inflicts regular damage.  Has a 20% chance to burn the target.',130,5,85,0,'special'),(765,'confusion',14,'Inflicts regular damage.  Has a 10% chance to confuse the target.',50,25,100,0,'special'),(766,'spit-up',0,'Inflicts regular damage.  Power is equal to 100 times the amount of energy stored by stockpile.  Ignores the random factor in the damage formula.  Stored energy is consumed, and the user\'s Defense and Special Defense are reset to what they would be if stockpile had not been used.  If the user has no energy stored, this move will fail.This move cannot be copied by mirror move.',0,10,100,0,'special'),(767,'morning-sun',0,'Heals the user for half its max HP.During sunny day, the healing is increased to 2/3 max HP.During hail, rain dance, or sandstorm, the healing is decreased to 1/4 max HP.',0,5,0,0,'status'),(768,'avalanche',17,'Inflicts regular damage.  If the target damaged the user this turn and was the last to do so, this move has double power.pain split does not count as damaging the user.',60,10,100,-4,'physical'),(769,'mystical-fire',9,'Inflicts regular damage.  Has a 100% chance to lower the target\'s Special Attack by one stage.',75,10,100,0,'special'),(770,'hidden-power',0,'Inflicts regular damage.  Power and type are determined by the user\'s IVs.Power is given by `x * 40 / 63   30`.  `x` is obtained by arranging bit 1 from the IV for each of Special Defense, Special Attack, Speed, Defense, Attack, and HP in that order.  (Bit 1 is 1 if the IV is of the form `4n   2` or `4n   3`.  `x` is then 64 * Special Defense IV bit 1, plus 32 * Special Attack IV bit 1, etc.)Power is always between 30 and 70, inclusive.  Average power is 49.5.Type is given by `y * 15 / 63`, where `y` is similar to `x` above, except constructed from bit 0.  (Bit 0 is 1 if the IV is odd.)  The result is looked up in the following table.Value | Type----: | --------    0 | fighting    1 | flying    2 | poison    3 | ground    4 | rock    5 | bug    6 | ghost    7 | steel    8 | fire    9 | water   10 | grass   11 | electric   12 | psychic   13 | ice   14 | dragon   15 | darkThis move thus cannot be normal.  Most other types have an equal 1/16 chance to be selected, given random IVs.  However, due to the flooring used here, bug, fighting, and grass appear 5/64 of the time, and dark only 1/64 of the time.',60,15,100,0,'special'),(771,'heart-swap',14,'User swaps its stat modifiers with the target.',0,10,0,0,'status'),(772,'feather-dance',2,'Lowers the target\'s Attack by two stages.',0,15,100,0,'status'),(773,'lands-wrath',15,'Inflicts regular damage.',90,10,100,0,'physical'),(774,'dive',8,'Inflicts regular damage.  User dives underwater for one turn, becoming immune to attack, and hits on the second turn.During the immune turn, surf, and whirlpool still hit the user normally, and their power is doubled if appropriate.The user may be hit during its immune turn if under the effect of lock on, mind reader, or no guard.This move cannot be selected by sleep talk.',80,10,100,0,'physical'),(775,'sandstorm',13,'Changes the weather to a sandstorm for five turns.  Pokémon that are not ground, rock, or steel take 1/16 their max HP at the end of every turn.  Every rock Pokémon\'s original Special Defense is raised by 50% for the duration of this effect.solar beam\'s power is halved.moonlight, morning sun, and synthesis only heal 1/4 the user\'s max HP.',0,10,0,0,'status'),(776,'shadow-ball',4,'Inflicts regular damage.  Has a 20% chance to lower the target\'s Special Defense by one stage.',80,15,100,0,'special'),(777,'thief',16,'Inflicts regular damage.  If the target is holding an item and the user is not, the user will permanently take the item.  Damage is still inflicted if an item cannot be taken.Pokémon with sticky hold or multitype are immune to the item theft effect.The target cannot recover its item with recycle.This move cannot be selected by assist or metronome.',60,25,100,0,'physical'),(778,'assurance',16,'Inflicts regular damage.  If the target takes damage this turn for any reason before this move is used, this move has double power.',60,10,100,0,'physical'),(779,'dazzling-gleam',6,'Inflicts regular damage.',80,10,100,0,'special'),(780,'grass-knot',11,'Inflicts regular damage.  Power increases with the target\'s weight in kilograms, to a maximum of 120.Target\'s weight | Power--------------- | ----:Up to 10kg      |    20Up to 25kg      |    40Up to 50kg      |    60Up to 100kg     |    80Up to 200kg     |   100Above 200kg     |   120',0,20,100,0,'special'),(781,'clamp',8,'Inflicts regular damage.  For the next 2–5 turns, the target cannot leave the field and is damaged for 1/16 its max HP at the end of each turn.  The user continues to use other moves during this time.  If the user leaves the field, this effect ends.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.rapid spin cancels this effect.',35,15,85,0,'physical'),(782,'detect',3,'No moves will hit the user for the remainder of this turn.  If the user is last to act this turn, this move will fail.If the user successfully used detect, endure, protect, quick guard, or wide guard on the last turn, this move has a 50% chance to fail.lock on, mind reader, and no guard provide a (100 – accuracy)% chance for moves to break through this move.  This does not apply to one-hit KO moves (fissure, guillotine, horn drill, and sheer cold); those are always blocked by this move.thunder during rain dance and blizzard during hail have a 30% chance to break through this move.The following effects are not prevented by this move:* acupressure from an ally* curse\'s curse effect* Delayed damage from doom desire and future sight; however, these moves will be prevented if they are used this turn* feint, which will also end this move\'s protection after it hits* imprison* perish song* shadow force* Moves that merely copy the user, such as transform or psych upThis move cannot be selected by assist or metronome.',0,5,0,4,'status'),(783,'reversal',3,'Inflicts regular damage.  Power varies inversely with the user\'s proportional remaining HP.64 * current HP / max HP | Power-----------------------: | ----: 0– 1                    |  200 2– 5                    |  150 6–12                    |  10013–21                    |   8022–42                    |   4043–64                    |   20',0,15,100,0,'physical'),(784,'sludge',12,'Inflicts regular damage.  Has a 30% chance to poison the target.',65,20,100,0,'special'),(785,'snore',0,'Only usable if the user is sleeping.  Inflicts regular damage.  Has a 30% chance to make the target flinch.',50,15,100,0,'special'),(786,'barrier',14,'Raises the user\'s Defense by two stages.',0,20,0,0,'status'),(787,'octazooka',8,'Inflicts regular damage.  Has a 50% chance to lower the target\'s accuracy by one stage.',65,10,85,0,'special'),(788,'psychic-fangs',14,'Destroys any light screen or reflect on the target\'s side of the field, then inflicts regular damage.',85,10,100,0,'physical'),(789,'scary-face',0,'Lowers the target\'s Speed by two stages.',0,10,100,0,'status'),(790,'milk-drink',0,'Heals the user for half its max HP.',0,10,0,0,'status'),(791,'discharge',7,'Inflicts regular damage.  Has a 30% chance to paralyze the target.',80,15,100,0,'special'),(792,'hyper-fang',0,'Inflicts regular damage.  Has a 10% chance to make the target flinch.',80,15,90,0,'physical'),(793,'sharpen',0,'Raises the user\'s Attack by one stage.',0,30,0,0,'status'),(794,'water-shuriken',8,'Inflicts regular damage.  Hits 2–5 times.',15,20,100,1,'special'),(795,'relic-song',0,'Inflicts regular damage.  Has a 10% chance to put the target to sleep.If the user is a meloetta, it will toggle between Aria and Pirouette Forme.',75,10,100,0,'special'),(796,'glare',0,'Paralyzes the target.',0,30,100,0,'status'),(797,'breakneck-blitz--physical',0,'Inflicts regular damage.',0,1,0,0,'physical'),(798,'continental-crush--physical',13,'Inflicts regular damage.',0,1,0,0,'physical'),(799,'blast-burn',9,'Inflicts regular damage.  User loses its next turn to \"recharge\", and cannot attack or switch out during that turn.',150,5,90,0,'special'),(800,'fire-blast',9,'Inflicts regular damage.  Has a 10% chance to burn the target.',110,5,85,0,'special'),(801,'flower-shield',6,'Raises the Defense of all grass Pokémon in battle.',0,10,0,0,'status'),(802,'fake-out',0,'Inflicts regular damage.  Causes the target to flinch.  Can only be used on the user\'s first turn after entering the field.',40,10,100,3,'physical'),(803,'spikes',15,'Scatters spikes around the opposing field, which damage opposing Pokémon that enter the field for 1/8 of their max HP.  Pokémon immune to ground moves are immune to this damage, except during gravity.  Up to three layers of spikes may be laid down, adding 1/16 to the damage done: two layers of spikes damage for 3/16 max HP, and three layers damage for 1/4 max HP.wonder guard does not block damage from this effect.rapid spin removes this effect from its user\'s side of the field.  defog removes this effect from its target\'s side of the field.',0,20,0,0,'status'),(804,'kinesis',14,'Lowers the target\'s accuracy by one stage.',0,15,80,0,'status'),(805,'attract',0,'Causes the target to fall in love with the user, giving it a 50% chance to do nothing each turn.  If the user and target are the same gender, or either is genderless, this move will fail.  If either Pokémon leaves the field, this effect ends.',0,15,100,0,'status'),(806,'dream-eater',14,'Fails if not used on a sleeping Pokémon.  Inflicts regular damage.  Drains half the damage inflicted to heal the user.',100,15,100,0,'special'),(807,'endeavor',0,'Inflicts exactly enough damage to lower the target\'s HP to equal the user\'s.  If the target\'s HP is not higher than the user\'s, this move has no effect.  Type immunity applies, but other type effects are ignored.  This effect counts as damage for moves that respond to damage.',0,5,100,0,'physical'),(808,'max-airstream',2,'',0,0,0,0,'status'),(809,'wicked-blow',16,'',80,5,100,0,'physical'),(810,'clanging-scales',10,'Inflicts regular damage.  Lowers the user\'s Defense by one stage.',110,5,100,0,'special'),(811,'grudge',4,'If the user faints before it next acts, the move that fainted it will have its PP dropped to 0.  End-of-turn damage does not trigger this effect.',0,5,0,0,'status'),(812,'never-ending-nightmare--special',4,'Inflicts regular damage.',0,1,0,0,'special'),(813,'clangorous-soul',10,'',0,5,100,0,'status'),(814,'max-steelspike',1,'',0,0,0,0,'status'),(815,'dragon-energy',10,'',150,5,100,0,'special'),(816,'max-flare',9,'',0,0,0,0,'status'),(817,'octolock',3,'',0,15,100,0,'status'),(818,'soul-stealing-7-star-strike',4,'Inflicts regular damage.',195,1,0,0,'physical'),(819,'snap-trap',11,'',35,15,100,0,'physical'),(820,'mist-ball',14,'Inflicts regular damage.  Has a 50% chance to lower the target\'s Special Attack by one stage.',70,5,100,0,'special'),(821,'return',0,'Inflicts regular damage.  Power increases with happiness, given by `happiness * 2 / 5`, to a maximum of 102.  Power bottoms out at 1.',0,20,100,0,'physical'),(822,'baton-pass',0,'User switches out, and the trainer selects a replacement Pokémon from the party.  Stat changes, confusion, and persistent move effects are passed along to the replacement Pokémon.The following move effects are passed:* aqua ring* both the user\'s and target\'s effect of block, mean look, and spider web* the curse effect of curse* embargo* focus energy or an activated lansat berry* gastro acid* ingrain* being sapped by leech seed* being targeted by lock on or mind reader* magnet rise* perish song\'s counter* power trick* substitute; the doll\'s HP is unchangedThe replacement Pokémon does not trigger effects that respond to Pokémon switching in.',0,40,0,0,'status'),(823,'veevee-volley',0,'Inflicts regular damage.  Power increases with happiness, given by `happiness * 2 / 5`, to a maximum of 102.  Power bottoms out at 1.',0,20,0,0,'physical'),(824,'vital-throw',3,'Inflicts regular damage.  Ignores accuracy and evasion modifiers.',70,10,0,-1,'physical'),(825,'grav-apple',11,'',80,10,100,0,'physical'),(826,'flip-turn',8,'',60,20,100,0,'physical'),(827,'final-gambit',3,'Inflicts damage equal to the user\'s remaining HP.  User faints.',0,5,100,0,'special'),(828,'flail',0,'Inflicts regular damage.  Power varies inversely with the user\'s proportional remaining HP.64 * current HP / max HP | Power-----------------------: | ----: 0– 1                    |  200 2– 5                    |  150 6–12                    |  10013–21                    |   8022–42                    |   4043–64                    |   20',0,15,100,0,'physical'),(829,'arm-thrust',3,'Inflicts regular damage.  Hits 2–5 times in one turn.Has a 3/8 chance each to hit 2 or 3 times, and a 1/8 chance each to hit 4 or 5 times.  Averages to 3 hits per use.',15,20,100,0,'physical'),(830,'wake-up-slap',3,'Inflicts regular damage.  If the target is sleeping, this move has double power, and the target wakes up.',70,10,100,0,'physical'),(831,'max-geyser',8,'',0,0,0,0,'status'),(832,'strange-steam',6,'',90,10,95,0,'special'),(833,'thousand-arrows',15,'Inflicts regular damage.  Grounds the target until it leaves battle.  Ignores levitation effects and the immunity of flying-type Pokémon.',90,10,100,0,'physical'),(834,'grassy-glide',11,'',70,20,100,0,'physical'),(835,'floral-healing',6,'Heals the target for ½ its max HP.  If grassy terrain is in effect, heals for ⅔ instead.',0,10,0,0,'status'),(836,'baneful-bunker',12,'Grants the user protection for the rest of the turn.  If a Pokémon attempts to use a move that makes contact with the user, that Pokémon will be poisoned.  This move\'s chance of success halves every time it\'s used consecutively with any other protection move.',0,10,0,4,'status'),(837,'scorching-sands',15,'',70,10,100,0,'special'),(838,'max-rockfall',13,'',0,0,0,0,'status'),(839,'megahorn',5,'Inflicts regular damage.',120,10,85,0,'physical'),(840,'odor-sleuth',0,'Resets the target\'s evasion to normal and prevents any further boosting until the target leaves the field.  A ghost under this effect takes normal damage from normal and fighting moves.  This move itself ignores accuracy and evasion modifiers.',0,40,0,0,'status'),(841,'power-trick',14,'The user\'s original Attack and Defense are swapped.This effect is passed on by baton pass.',0,10,0,0,'status'),(842,'leech-life',5,'Inflicts regular damage.  Drains half the damage inflicted to heal the user.',80,10,100,0,'physical'),(843,'haze',17,'Removes stat, accuracy, and evasion modifiers from every Pokémon on the field.This does not count as a stat reduction for the purposes of clear body or white smoke.',0,30,0,0,'status'),(844,'harden',0,'Raises the user\'s Defense by one stage.',0,30,0,0,'status');
